  render() {                
    return (
      <div className="Home">
      <img src="/images/fundacao.png" width="60%" height="60%"/>
      <br/>
      <div className="Homebtn"> 
      <Button outline color="warning" light>Login</Button>
      <Button outline color="warning">Signup</Button>
      </div>
      </div>
    );
  }
}
